import React from 'react';
import ReactDOM from 'react-dom';
import App from './components/App';
import './assets/styles/main.css';
import ScrollAnim from 'rc-scroll-anim';

setTimeout(() => {
ScrollAnim
.scrollScreen
.init({loop: false, duration: 0, ease: "easeInOutCirc", scrollInterval: 3000});
}, 300);

ReactDOM.render(<App key='aaa' />, document.getElementById('root'));
